var AWait = (function(){



    var T = function(time,ajax){

      if(!ajax)ajax = {from:0,to:100};

      var settings = ajax;

      

      var callback=null;

      var next = null;

      var methods = {

        time :time,

        next : function(f){

          next = f;

          return this;

        },

        run : function(f){

          callback = f;

          run();

          return this;

        },

        refresh : function(){

            run();

            return this;

        }

      };

      var run = function(){

        setTimeout(function(){

          if(typeof callback ==="function"){

            callback.call(this,settings,function(ok){

              if(ok){

                if(typeof next==="function"){

                  next.call(methods);

                }

                 

                 run(); 

              }

            });

          }

        },methods.time);

      };

      

      return methods;

    };

    return T;

})();

