function delay(callback, ms) {

  var timer = 0;

  return function() {

    var context = this, args = arguments;

    clearTimeout(timer);

    timer = setTimeout(function () {

      callback.apply(context, args);

    }, ms || 300);

  };

}





//slider

$(document).ready(function(){

  var loaded =false;

  function initSlide(){

    $('[data-slider]').each(function(i,v){

      if(!this.loaded){

        this.loaded = true;

        var info = $(this).data("slider").split(';');

        var col = info[0];

        var pos = info[1];

        var dot = info[2]==1;

        $(this).addClass("slider-"+pos).owlCarousel({

            // loop:true,

            margin:5,

            nav:true,

            responsiveClass:true,

            responsive:{

                0:{

                    items:1

                },

                600:{

                    items:2

                },

                1000:{

                    items:4

                },

                1500:{

                    items:col

                },

                1900:{

                    items:col+1

                }

            }

        });

      }

    }); 

  }

  initSlide();

  

  function initCountdown(){

    $('[data-countdown]').each(function(i,v){

      if(!this.loaded){

        this.loaded = true;

        var me = $(v);

        me.countdown(me.data("time")).on('update.countdown', function(event) {

          var format = me.data("format");

          if(event.offset.totalDays > 0) {

            format = '%-d day%!d ' + format;

          }

          if(event.offset.weeks > 0) {

            format = '%-w week%!w ' + format;

          }

          $(this).html(event.strftime(format));

        }).on('finish.countdown', function(event) {

          me.html('This offer has expired!')

            .parent().addClass('disabled');



        });

      }

    });

  }

  //

  setTimeout(function(){

    $("body").bind("DOMSubtreeModified", function(){

      initSlide();

      initCountdown();

    });

  },3000);

});

