       //update

       dom.on("click",".btn-update",function(){

          var tr = $(this).closest("tr");

          tr.find("td").each(function(i,v){

              var col=ingore_index["col_"+i];

              if(col){

                var td = $(v);

                var n ={};

                 if(plugin.options.columns && plugin.options.columns[col.name] && typeof plugin.options.columns[col.name].update==="function"){

                    n = plugin.options.columns[col.name].update(td,col);

                    

                 }else{

                   n = td.find("input").val().trim();

                   n={value:n,text:n};

                   td.find("input").remove();

                   td.html(n);

                 }

                 //check validate

                 var ok =true;

                 if(plugin.options.columns && plugin.options.columns[col.name]){

                   if(typeof plugin.options.columns[col.name].validate==="function"){

                    ok = plugin.options.columns[col.name].validate(n);

                   }

                 }



                 if(ok){

                    td.data("value",n.value);

                    td.data("text",n.text);

                    td.html(n.text);

                 }

              }

          });



          $(this).hide();

          tr.find(".btn-delete").show();

          tr.find(".btn-edit").show();

          tr.find(".btn-cancel").hide();



          dom.trigger("onUpdate",[tr,plugin.getDataRow(tr.index())]);

       });



       //delete

       dom.on("click",".btn-delete",function(){

          var tr = $(this).closest("tr");

          dom.trigger("onDelete",[tr,plugin.getDataRow(tr.index()),function(){

              tr.remove();

          }]);

       });

       //cancel

       dom.on("click",".btn-cancel",function(){

          var tr = $(this).closest("tr");

          tr.find("td").each(function(i,v){

              var col=ingore_index["col_"+i];

              if(col){

                var td =$(v);

                var n = td.data("value");

                if(plugin.options.columns && plugin.options.columns[col.name] && typeof plugin.options.columns[col.name].cancel==="function"){

                    n = plugin.options.columns[col.name].cancel(td,n);

                 }

                td.html(n);

              }

          });

          $(this).hide();

          tr.find(".btn-delete").show();

          tr.find(".btn-update").hide();

          tr.find(".btn-edit").show();

       });



        //add function and excute edit

        if(this.options.alwaysAdd&&dom.find(".tr-add").length>0){

          var table = dom.parent().find(".form-edit-tb");

          //add new table add

          if(table.length==0){

            table = $('<div class="form-edit-tb"><form><table><tbody></tbody></table></form></div>');

            table.insertBefore(dom);

          table = table.find("table");

          dom.find(".tr-add").appendTo(table.find("tbody"));

          }else{

            var table_ = table.find("form");

            if(table_.length==0){

              table.append('<form></form>');

            }else{

              var c = table.find("table");

              if(c.length==0){

                table_.prepend('<table><tbody></tbody></table>');

                dom.find(".tr-add").appendTo(table.find("tbody"));

              }

            }

            table = table.find("table");

          }

          table.find(".tr-add").find("td").each(function(i,v){

              var col=ingore_index["col_"+i];

              if(col){

                var td = $(v);

                var value = td.data("value");

                if(!value){

                  value="";

                  td.data("value",value);

                }

                 if(plugin.options.columns && plugin.options.columns[col.name] && typeof plugin.options.columns[col.name].edit==="function"){

                    plugin.options.columns[col.name].edit(td,value);

                 }else{

                   td.html('<input type="text" value="'+value+'" />');

                 }

              }



          });

          table.find(".tr-add").closest("form").validate({

          submitHandler:function(form){



          }

         });

          //when clear in adding

          table.on("click",".tr-add .btn-clear",function(){

            $(this).closest("tr").find("td").each(function(i,v){

                var col=ingore_index["col_"+i];

                if(col){

                  var td = $(v);

                   if(plugin.options.columns && plugin.options.columns[col.name] && typeof plugin.options.columns[col.name].reset==="function"){

                     plugin.options.columns[col.name].reset(td);

                   }else{

                     td.find("input,select,textarea").val("");

                   }

                }

            });

          });

          table.on("click",".tr-add .btn-add",function(){

            var data = {};

            var run = true;

            var tr = $(this).closest("tr");

            tr.find("td").each(function(i,v){

                var col=ingore_index["col_"+i];

                if(col){

                  var td = $(v);

                  var n ={};

                   if(plugin.options.columns && plugin.options.columns[col.name] && typeof plugin.options.columns[col.name].update==="function"){

                      n = plugin.options.columns[col.name].update(td,col);

                      

                   }else{

                     n = td.find("input").val().trim();

                     n={value:n,text:n};

                   }

                   //check validate

                   var ok =true;

                   if(plugin.options.columns && plugin.options.columns[col.name]){

                     if(typeof plugin.options.columns[col.name].validate==="function"){

                      ok = plugin.options.columns[col.name].validate(n);

                     }

                   }



                   if(ok){

                     data[col.name] = n.value;

                   }else{

                     run = false;

                   }

                }

            });

            //

            tr.closest("form")[0].submit();

            if(run){



               plugin.dom.trigger("onAdd",[tr.closest("form"),data]);

            }

          });

        }



       //////////////////////////Method

       plugin.getDataRow= function(index){

          var data = {};

          dom.find("tbody tr").eq(index).find("td").each(function(i,v){

            var col=ingore_index["col_"+i];

            if(col){

                data[col.name]=$(v).data("value");

            }

          });

          return data;

       };

        plugin.add= function(data){

            var tr="";

            for(var i in data){



            }

            this.tbody.append('<tr>'+tr+'</tr>');

          return this;

       };

       plugin.addHTML= function(data){

          this.tbody.append(data);

          return this;

       };

       plugin.getData= function(col){

          var data = [];



          dom.find("tbody tr").each(function(i,v){

              var s = {};

              tr.find("td").each(function(i,v){

                var col=ingore_index["col_"+i];

                if(col){

                    s[col.name]=$(v).data("value");

                }

            });

            data.push(s);

          });



          if(col){

            var s = [];

              if(typeof col==="string"){

                 for(var i in ingore_index ){

                   if(ingore_index[i].name==col){

                      for(var j in data ){

                        var m = {};

                        m[ingore_index[i].name] = data[j][ingore_index[i].name];

                        s.push(m);

                      }

                   }

                 }

                 return s; 

              }else{

                 var name = ingore_index["col_"+col]?ingore_index[i].name:null;

                 if(name){

                      for(var j in data ){

                        var m = {};

                        m[name] = data[j][name];

                        s.push(m);

                      }

                 }

              }

              return s;

          }

          return data;

       };



       plugin.remove=function(i){

          var tr = dom.find("tbody tr").eq(i);

          dom.trigger("onDelete",[plugin.getDataRow(tr.index()),function(){

              tr.remove();

          }]);

          return this;

       };

      //lookup string

      plugin.lookup= function (str){

        if(!str){

          this.dom.find("tbody tr").fadeIn();

          return;

        }

        str = str.make_slug().split('-');



        $.each(str,function(i,value){       

           plugin.dom.find("tbody tr").each(function() {

              var ok = 0;

              if(plugin.options.on && typeof plugin.options.on.lookup==="function"){

                ok = plugin.options.on.lookup($(this),value);

              }else{

                $(this).find("td").each(function() {

                    var me = $(this);  

                    var find = me.text().trim().make_slug().replace("-"," ");

                    // var sku = me.attr('data-sku')?me.attr('data-sku').trim():"";

                    if(plugin.options.on && typeof plugin.options.on.lookup==="function"){

                      ok = plugin.options.on.lookup(me.closest,value);

                    }else if(find.indexOf(value)!=-1){

                      ok =1;

                    }

               });  

              }

              //go

              if(ok){

                $(this).fadeIn();

              }else{

                $(this).fadeOut();

              }

           });

        });

        return this;

      };



      //download

      var Export=(function(){

            var methods={

              download : function(content, fileName, mimeType) {

               var csvContent = '';

                content.forEach(function(infoArray, index) {

                  var dataString = infoArray.map(function(v){return "\""+v+"\"";}).join(',');

                  csvContent += index < content.length ? dataString + '\n' : dataString;

                });

                content = csvContent;



                var a = document.createElement('a');

                mimeType = mimeType || 'application/octet-stream';



                if (navigator.msSaveBlob) { // IE10

                  navigator.msSaveBlob(new Blob(["\uFEFF"+content], {

                    type: mimeType

                  }), fileName);

                } else if (URL && 'download' in a) { //html5 A[download]

                  a.href = URL.createObjectURL(new Blob(["\uFEFF"+content], {

                    type: mimeType

                  }));

                  a.setAttribute('download', fileName);

                  document.body.appendChild(a);

                  a.click();

                  document.body.removeChild(a);

                } else {

                  location.href = 'data:application/octet-stream,"\uFEFF"' + content; // only this mime type is supported

                }

              },

              CSV : function(options,f){

                  var content = [];

                  var ingore = options.ingoreColumn;

                  var ingore_index = {};

                  var td=null;

                  if(options.header===true){

                    var header = [];

                    var td = plugin.dom.find("thead td").length>0?plugin.dom.find("thead td"):plugin.dom.find("thead th");

                    td.each(function(i,v){

                      var col="col_"+i;

                      if((ingore && ingore.indexOf(i)==-1) || $(v).data("ingore")==1 || !$(v).hasClass("ingore")){

                        header.push($(v).text().trim());

                        ingore_index[col]={

                           name : $(v).data("name")

                        }

                      }

                      else{

                        ingore_index[col]=null;

                      }

                    });

                    content.push(header);

                  }

                  //

                  plugin.dom.find("tbody tr").each(function(i,v){

                    var a =[]

                    $(v).find("td").each(function(k,n){

                      var col="col_"+k;

                      var s = "";

                      if(ingore_index[col]){

                        

                        if(typeof f==="function"){

                          s = typeof f==="function"?f($(n),k):$(n).text().trim()

                        }else if(typeof f==="object" && td && typeof f[ingore_index[col].name]==="function"){

                           s = f[ingore_index[col].name]($(n),k);

                        }else{

                          s = $(n).text().trim();

                        }

                        a.push(s);

                      }

                    });

                    content.push(a);

                  });

                  if(typeof options.override ==="function"){

                     var a = options.override(content);

                     if(typeof a ==="object"){

                      content =a;

                     }

                  }

                  methods.download(content, options.name, options.minetype);

                }

            };



            return methods;

        })();

        

      plugin.Export = function(options,f){

         Export.CSV(options,f);

         return this;

      };

