function sortAZ(obj) {

    if (typeof obj !== "object" || obj === null)

        return obj;



    if (Array.isArray(obj))

        return obj.map((e) => sortAZ(e)).sort();



    return Object.keys(obj).sort().reduce((sorted, k) => {

        sorted[k] = sortAZ(obj[k]);

        return sorted;

    }, {});

}



