function urls_parser(str,func){

    var regExp = /(https?:\/\/(?:www\.|(?!www))[^\s\.]+\.[^\s]{2,}|www\.[^\s]+\.[^\s]{2,})/gi;

    var match = str.match(regExp);

    if(match){

      var is_callback= typeof func=="function";

        match.map(function(v){

         

          var str_b = v;

          if(is_callback){

            var s= func(v);

            if(s){

              str_b = s;

            }else{

              var u_ = v+(v.indexOf("?")!=-1?"&":"?")+"open=true";



              str_b = '<a href="'+u_+'">'+v+'</a>';

            }

            

          }else{

            var u_ = v+(v.indexOf("?")!=-1?"&":"?")+"open=true";

            str_b = '<a href="'+u_+'">'+v+'</a>';

          }



          str = str.replace(v,str_b);



      return v;

    });

    }



    return str;

}

