    $.ajax(

    {

        url: url,

        type: "POST",

        contentType: false,

        cache: false,

        processData: false,

        async: true,

        data: c,

        xhr: function()

        {

            var d = null;

            if (window.ActiveXObject)

            {

                d = new window.ActiveXObject("Microsoft.XMLHTTP")

            }

            else

            {

                d = new window.XMLHttpRequest()

            }

            d.upload.addEventListener("progress", function(e)

            {

                if (e.lengthComputable)

                {

                    var f = Math.round((e.loaded * 100) / e.total);

                    a.progress(f, e);

                    console.log("Uploaded percent", f)

                }

            }, false);

            d.upload.onprogress = function(e){

                if (e.lengthComputable)

                {

                    var f = Math.round((e.loaded * 100) / e.total);

                    a.progress(f, e);

                    console.log("Uploaded percent", f)

                }

            };

            d.addEventListener("progress", function(e)

            {

                if (e.lengthComputable)

                {

                    var f = Math.round((e.loaded * 100) / e.total);

                    console.log("Downloaded percent", f)

                }

            }, false);

            d.onprogress = function(e){

                if (e.lengthComputable)

                {

                    var f = Math.round((e.loaded * 100) / e.total);

                    a.progress(f, e);

                    console.log("Uploaded percent", f)

                }

            };

            if(a.init)

            a.init();

            return d

        },

        success: function(d)

        {

            console.log("Completed.");

            a.complete.call(b,d);

        }

    })

