    randomPoints: (function() {
       function a(center, radius){
        radius=radius?radius:3;
          var x0 = center.lng;
        var y0 = center.lat;
        // Convert Radius from meters to degrees.
        var rd = radius/111300;

        var u = Math.random();
        var v = Math.random();

        var w = rd * Math.sqrt(u);
        var t = 2 * Math.PI * v;
        var x = w * Math.cos(t);
        var y = w * Math.sin(t);

        var xp = x/Math.cos(y0);

        // Resulting point.
        return {'lat': y+y0, 'lng': xp+x0};
       }
       //generateRandomPoints({'lat':24.23, 'lng':23.12}, 1000, 100);
       return function(center, radius,count){
          count = count?count:50;
           var points = [];
          for (var i=0; i<count; i++) {
            var n = Math.floor(Math.random() * 200);
            points.push(a(center, n));
          }
          return points;
       };
    })(),
