var MyLoader = (function (msg){
  
  $(document).ready(function(){
    
  });
  return function(msg){
    var callback_ok = callback_no=null;
    var msg = msg?msg:'<p class="text-center mb-0"><i class="fa fa-spin fa-cog"></i> Please wait while we do something...</p>';
    var dialog = bootbox.dialog({
        onEscape: false,
        backdrop: true,
        message: '<div class="ads"></div><div class="msg">'+decodeURIComponent(msg)+'</div>',
        buttons: {
            cancel: {
                label: "Close",
                className: 'btn-primary',
                callback: function(){
                    if(callback_no){
                      callback_no();
                    }
                    dialog.modal('hide');
                }
            },
            ok : {
               label: "Ok",
                className: 'btn-success',
                callback: function(){
                    if(callback_ok){
                      callback_ok();
                    }
                    dialog.modal('hide');
                }
            }
        }
    }).addClass("myloader");
    dialog.find(".close").remove();
    dialog.find(".modal-footer").hide();
    if(window.AAds){
      window.AAds.inline(dialog.find(".ads"));
    }
    try{
      msg = decodeURIComponent(msg);
    }catch(ex){}
    var methods = {
      ok : function(msg,callback){
        callback_ok = callback;
        dialog.find(".modal-body .msg").addClass("text-success").html(msg);
        dialog.find(".modal-footer").show();
        dialog.addClass("in");
        return this;
      },
      no : function(msg,callback){
         callback_no = callback;
        dialog.find(".modal-body .msg").addClass("text-danger").html(msg);
        dialog.find(".modal-footer").show();
        dialog.addClass("in");
        return this;
      },
      hide: function(timer){
        if(timer){
          setTimeout(function(){
            dialog.modal('hide');
          },timer);
        }else{
           dialog.modal('hide');
        }
      },
      modal:function(){
        return dialog;
      }
    };
    return methods;
  };
})();

