      modaljs : function(btn,func){
        btn.addClass("btn-open is-active").on('click', function (e) {

          var modal = $($(this).data('modal')),me=$(this);
          modal.data("_ref",me);

          me.toggleClass( 'is-active');
          modal.addClass( 'is-active');
          modal = modal[0];
          // Define initial properties
          dynamics.css(modal, {
            opacity: 0,
            scale: .5 });


          // Animate to final properties
          dynamics.animate(modal, {
            opacity: 1,
            scale: 1 },
          {
            type: dynamics.spring,
            frequency: 300,
            friction: 400,
            duration: 1000 });

          // Animate each child individually
          var modalChildren =  modal.children,l=modalChildren.length;
          for (var i = 0; i <l; i++) { 
            var item = modalChildren[i];

            // Define initial properties
            dynamics.css(item, {
              opacity: 0,
              translateY: 30 });


            // Animate to final properties
            dynamics.animate(item, {
              opacity: 1,
              translateY: 0 },
            {
              type: dynamics.spring,
              frequency: 300,
              friction: 400,
              duration: 1000,
              delay: 100 + i * 40 });

          } 
      });

      // Open nav when clicking sandwich button
      $(document).on('click','.modaljs .js-close', function (e) {
        var modal = $(".modaljs.is-active");
          if(modal.length>0){
              dynamics.animate(modal[0], {
            opacity: 0,
            translateY: 100 },
          {
            type: dynamics.spring,
            frequency: 50,
            friction: 600,
            duration: 1500 });

          dynamics.setTimeout(function(){
            modal.toggleClass( 'is-active');

            
          }, 500);

          var who =  modal.data("_ref");
          if(who){
             dynamics.setTimeout(function(){
              if(typeof func==="function"){
                func();
              }
              who.removeClass("btn-open is-active").off('click');

              who.toggleClass( 'is-active');
            }, 500);
          }
        }
        
      });
      },
