function cache_page(name,url,data){
    return new Promise(function(resolve,reject){
      var go = function(func){
        post(url,AAuth.data(data?data:{}),function(res){
          if(typeof res=="object"){
            func(res);
          } 
        },true);
      }
      if(window.localStorage[name]){
        resolve(JSON.parse(window.localStorage[name]));
        go(function(res){
            window.localStorage[name] = JSON.stringify(res);
        });
      }else{
        go(function(res){
            resolve(res);
            window.localStorage[name] = JSON.stringify(res);
        });
      }

      
    });
 }
