$(document).on("OutletChange",function(e,outlet){
  var config = AppConfig;
   
  if(window.socketserver){

    console.log('socket load',window.socketserver);

    if(!config.sockethost){
        //connect main socket
        var socket_url = config.socket?config.socket.host:"https://tu-ech-default-rtdb.firebaseio.com";
        var options = {"io":socket_url,room:"POS"+config.shop_id,limit:10};

        options.user = window.user||{};

        //

        config.sockethost = socketserver.firebase(options);
        /////////////messages///////////////////
        (function(){
          config.sockethost.io.messages = new Firebase(socket_url).child('messages');
          config.sockethost.io.messages.send = function(data){
              if(!data._id)data._id = Date.now();
             data.shop_id = config.shop_id;
             data.user = {
               _id: window.user.id_user||window.user.id,
               avatar : window.user.avatar,
               name : window.user.fullname?window.user.fullname:'--'
             };

             if(!data.user._id){
               delete data.user;
            }
             this.push(data);
          };
          var load =0;
          config.sockethost.io.messages.limitToLast(1).on("child_added",function(snapshot){
            if(load==1){
              var data = snapshot.val();
              // console.log('messages in shop: ',data);
              if(data&&data.shop_id==config.shop_id){  

                   $(document).trigger("socket_shop_messages",[data]);
                }
              }else{
                 setTimeout(function(){
                  load = 1;
                 },1000);
            }  
          });
        })();
        /////////////qraccess///////////////////
        (function(){
          config.sockethost.io.qraccess = new Firebase(socket_url).child('qraccess');
          config.sockethost.io.qraccess.send = function(data){
              if(!data._id)data._id = Date.now();
             data.shop_id = config.shop_id;
             data.user = {
               _id: window.user.id_user,
               avatar : window.user.avatar,
               name : window.user.fullname?window.user.fullname:'--'
             };
             this.push(data);
          };
          var load =0;
          config.sockethost.io.qraccess.limitToLast(1).on("child_added",function(snapshot){
            if(load==1){
              var data = snapshot .val();
              console.log('User data qraccess: ',data);
              if(data&&data.user&&data.user._id=='board'&&data.shop_id==config.shop_id){  
                 
                    var res =  data.callback_data;
                    
                    if(res.code){

                    }else{

                    } 
                }
              }else{
                 setTimeout(function(){
                  load = 1;
                 },1000);
            }  
          });
        })();
        /////////////////////////////////
      
        AppSocket(config);

    }
    
    
  }
  

});
 
