  function findMatches(wordToMatch, cities) {

    return cities.filter(place => {

      var regex = new RegExp(wordToMatch, "gi");

      try{

        return place&&place.title&&place.title.match(regex) || place.title.make_slug().includes(wordToMatch.toLowerCase()) || place.barcode.includes(wordToMatch.toLowerCase()) || place.barcode_in.includes(wordToMatch.toLowerCase());

      }catch(e){}

      return false;

    });

  }



  function numberWithCommas(x) {

    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',');

  }





