  function render_item(place){   

    return `

      <li style="display:flex" data-id="${place.id}">        

        <div class="bg">

          <img src="${place.image}" style="width: 55px;height: 35px;" />

        </div> 

        <div style="flex: 1; margin-left: 16px;">

          <div>

            <span class="name">${place.title}</span> 

          </div> 

        </div>        

      </li>

    `;

  }



  function load_url(value,url,f){

    $.ajax({

      url: url,

      data : {s:value},

      async: true, 

      method:'post',

      beforeSend: function(jqXHR, settings) {

         

        jqXHR.setRequestHeader("auth-token", $("meta[name='atoken']").attr("content"));

        

      },

      success: function (json) {

        try{

          json=JSON.parse(json);

        }catch(ex){



        }



        f(json);

      }

    }); 

  }



