  String.prototype.navigate = function(data,context){
   if(!window.modals){
      window.modals={};
   }

     var name = this.toString();

     var modal_active = $(".modal.active");


     var modal = $(name);

     if(modal.length==0){

        modal = $("#"+name);

     }
 
     

     var abc = context?(context.length?context:$(context)):null;

     if(abc){

       data = $.extend(data,abc.data(),true);

     }

     

     name = name.replace("#","").replace(".","");

     if(modal.length>0){

        modal.data("caller",abc).data("params",data);

     }else if(modals[name]){

       $("body").append(modals[name]);
 
        modal = $("#"+name).data("caller",abc).data("params",data);

     }else{

       $("body").append(modals[name]);
 
        modal = $("#"+name).data("caller",abc).data("params",data);

     }

     



     // modal.on('hidden.bs.modal',function(){
 

     // });
     
     if(modal.length==0){
         var s = `${name} not exist. Please review your module or contact owner of module which you are using.`;
         if(typeof toastr=="object"){
            toastr.warning(s,"Thông báo");
         }else{
             console.warn(s);
         }
        
         return;
     }

     if(!modal[0].loaded){
        modal.trigger('init.bs.modal');
     }

     if(modal_active.length ){
       //check this coming page has back
       if(!modal_active.hasClass("no")){
         modal.data("prev",modal_active);
       }
       
     }
     
     //check for active page
     if(modal.hasClass("in")&&modal[0].loaded){
         return modal.trigger('shown.bs.modal').addClass('in');
     }else{
         return modal.modal();
     }
 
     // return modal.modal().addClass('in');
  }


  

