  // $(".actioninv").append('<button type="button" contenteditable class="btn  btn-default mh" data-id="'+order.id+'">'+order.name+'</button>');
  $(".blockorder").append('<div class="order active" data-id="'+order.id+'" id="inv'+order.id+'"></div>');
  var form = $("#inv"+order.id).append(forminv);
  order.$ = {
    tab: $(".actioninv .btn[data-id='"+order.id+"']"),
    order: form,
    tlp:form.find(".products tbody").html()
  };
  form.find(".products tbody").html("");

  form.on("click","select.id_customer,select.id_ship,select.id_kbh,select.id_nvgh",function(){
    if(this.value){
      order[$(this).data("name")] = this.options[this.selectedIndex].text;
      order.calc();
    }
    
  });

  form.on("change",".actioninv [contenteditable]",function(){
    if(this.value.length>1){
      order.name = this.value;
      order.calc();
    }else{
      toastr.warning("Tên Hoá đơn có ít nhất 2 kí tự","Cảnh báo");
    } 
  });


  order.serialize = function(){
    var a = {};
    for(var i in order){
      if(i!="$" && typeof order[i] !="function"){
        a[i]=order[i];
      }
    }
    var s = $.extend(a,order.$.order.find("form").serializeObject(),true);
    return JSON.parse(JSON.stringify(s));
  };
  order.empty = function(){
      return order.track_order && Object.keys(order.track_order)==0
  };

  
  order.pay = function(fun){
      order.barcode = moment().format('YYYYMMDDHmmss');
      $(document).on('beforeCheckout',[order]); 
      var data = order.serialize();


      //try cache
      var id_cache = moment().format('YYYY-MM-DD-H-mm-ss')+data.id;
      if(typeof boundAsync =="object"){
        boundAsync.setHtml(id_cache,JSON.stringify(data));
      }else{
        download(id_cache, JSON.stringify(data));
      }

      order.tryActive();
 
     
      
      $(document).trigger('ajaxBeforeCheckout',[order]); 
      post(site_url_ajax("api/shop/complete/"),data,function(res) {
        // $(document).trigger('afterCheckout',[data,res]);
 
        if(fun)fun(res);


      },true);
      this.delete();
      return order;
    };
    order.payandprint = function(fun){
      order.pay(fun);
      post(site_url_ajax("api/print/txt/"),order.serialize(),function(res) {},true);
      return order;
    };
    
    order.calc = function(saved){
      //update layout
      var s="";
      order.subtotal = 0;
      var form = order.$.order;
      window.ATable.events.render_cart(order);
 
     
      
      //total
      order.total = order.subtotal;
      // + or -
      if(order.checkout && order.checkout.plus){
        form.find(".plus").html("");
        $.each(order.checkout.plus,function(i,info) {
           order.total+=info.value*1;

           if(form.find(".plus ."+info.key).length==0){
             form.find(".plus ."+info.key).remove();
            }
            form.find(".plus").append('<div class="block '+info.key+'" > <span>'+info.label+'</span><span  style="margin-left:20px;">-'+show_money_none(info.value)+' <span class="remove" data-type="reduce" data-key="'+info.key+'" style="margin-left:20px;"><i class="fa fa-times" aria-hidden="true"></i></span></span></div>');

        });
      }

      if(order.checkout && order.checkout.reduce){
        form.find(".reduce").html("");
        $.each(order.checkout.reduce,function(i,info) {
           order.total-=info.value*1;
           if(form.find(".reduce ."+info.key).length==0){
             form.find(".reduce ."+info.key).remove();
            }
            if(info.key=="discount"){
              form.find(".reduce").append('<div class="block '+info.key+'"><span >'+info.label+' ('+info.per+'%)</span><span  style="margin-left:20px;">'+show_money_none(info.value)+'<span class="remove"  data-type="reduce" data-key="'+info.key+'"  style="margin-left:20px;"><i class="fa fa-times" aria-hidden="true"></i></span></span> </div>');
            }else{
              form.find(".reduce").append('<div class="block '+info.key+'"><span >'+info.label+'</span><span  style="margin-left:20px;">'+show_money_none(info.value)+'<span class="remove"  data-type="reduce" data-key="'+info.key+'"  style="margin-left:20px;"><i class="fa fa-times" aria-hidden="true"></i></span></span> </div>');
            }
            
        });

        // if(order.checkout.reduce["discount"]){
        //     form.find(".reduce")
        // }
      }

      //final
      // form.find(".total_menu").html(show_money_none(c));
      form.find(".subtotal").html(show_money_none(order.subtotal));
      form.find(".total").html(show_money_none(order.total));

      var num=0;
      // console.log(form.find(".quantity_change"));
      form.find(".quantity_change").each(function(i,v){

        num+=$(v).val()*1;
      });

      form.find(".total_num").html(show_money_none(num));

     var aaa = order.save();
      
      if(!saved)$(document).trigger('onChangeCheckout',[order]);
      
      if(!saved) return aaa;
    };
