window.renderData = function(u,modal){ 
    for(var i in u){
      var a = modal.find('.'+i);
      if(a.length==0){
        a = modal.find(`[name="${i}"]`);
      }
      if(a.length){
          switch(a[0].nodeName.toLowerCase()){
            case 'input':
                if(a[0].type=='radio' || a[0].type=='checkbox' ){
                    a[0].checked = a[0].value==u[i];
                }else{
                  a.val(u[i]);
                }
            break;
            case 'select':
            case 'textarea':
                a.val(u[i]);    
            break;
            default:
                a.html(u[i]);   
            break;
          }
          
        }
    }   
};
