window.MyDataTable=function (ele,otps){

   if(ele&&ele.length==undefined){
                ele  =$(ele);
            }
            if(ele&&ele.destroy)ele.destroy();

    var columns ={};

    var tmp_row ="";

    var table = "tb-"+Date.now();



    otps = $.extend({
         
      height:400,

      dom: 'Blfrtip',

      buttons: [

          'copyHtml5',

          'excelHtml5',

          'csvHtml5',

          'pdfHtml5'

      ],

        columnsSkip :[],

        columnsInclude :["id"],

        columns: [

            { "data": "image" },

            { "data": "title" }

        ],

        

        createdRow: function ( row, data, index ) {

                        // if ( data[5].replace(/[\$,]/g, '') * 1 > 150000 ) {

                        //     $('td', row).eq(5).addClass('highlight');

                        // }

                        otps.renderRow(row, data, index,tmp_row);

                    } 

         

      },otps,true);

     otps.processing =true;

    

    //check

    if(otps.url){

      if(typeof otps.url=="function"){

        setTimeout(function(){

           var final =[];

            for(var i in columns){

              if(!otps.columnsSkip.includes(i)){

                final.push(i);

              }

            }

          otps.url.call({cols:final},function(data){

            console.log(data);

             // var tb = $("."+table).DataTable();

             // tb.destroy()

             // $("."+table).empty();

             otps.data = data;

             $("."+table).DataTable(otps);

          });

          

        },1000);

      }else{

       

        otps.serverSide =true;

         otps.ajax = {

            "url": otps.url?otps.url:document.location.href,

            "type": "POST",

            beforeSend: function(jqXHR, settings) {

              jqXHR.setRequestHeader("auth-token", $("meta[name='auth-token']").attr("content"));

            // console.log(settings);

            var final =[];

            for(var i in columns){

              if(!otps.columnsSkip.includes(i)){

                final.push(i);

              }

            }

            settings.url = settings.url+(settings.url.includes("?")?"&":"?")+"col="+JSON.stringify(final);

            if(otps.data)

            {

              var s= "";

              for(var i in otps.data){

                s += `${i}=`+encodeURIComponent(otps.data[i])+"&";

              }

              

              settings.data +=(settings.data?"&":"?")+s;

              // console.log(settings.data);

            }

          },

          dataSrc: function (json) {

            if(!json.data || json.data.length==0){

              $(".loading").addClass("hide");

              $(".body-load").removeClass("active");

            }



            $.each(json.data,function(k,v){

              for(var i in columns){

                if(typeof columns[i].renderHTML==="function"){

                  var s = columns[i].renderHTML(v[i],v);

                  v[i] = s;

                }else{

                  v[i] = v[i]?v[i]:"";

                }

              }

            });           

            return json.data;

          }

        };

      }

    }



    //try process columns

     var th='';

     $.each(otps.columns,function(k,v){

       

        columns[v.data] = v;

        th+=`<th>${v.title}</th>`;

         tmp_row+=v.template?v.template:`<th>{{${v.data}}}</th>`;

     });

     //append hidden column

     $.each(otps.columnsInclude,function(k,v){

       columns[v] = {name:v};

     });





      table = ele.html(`<table style="height:${otps.height}px" class="table table-bordered table-striped ${table}">

        <thead>

            <tr>

               ${th}

            </tr>

        </thead> 



      </table>`).find("table").DataTable(otps);



     return {

       filter: function(){



       },

       draw : function(data){

         var tb = $("."+table).DataTable();

         tb.clear();

         tb.rows.add( data ).draw();

       }

     };

  };
      
(function(win){
  $(document).on('click','.scrollable>*', function(e) {

    e.preventDefault(); 
    var me = $(this);
    var scrollable = me.closest(".scrollable");
    var x = scrollable.css("overflow-x");
    var y = scrollable.css("overflow-y");
    if(x=="auto" || x=="scroll"){
      scrollable.animate({scrollLeft: me.position().left}, 750);
    }
    
    if(x=="auto" || y=="scroll"){
      scrollable.animate({scrollTop: me.position().top}, 750);
    }

  });
})(window);
