    var handleKeyPress = function(e){

        if (e.keyCode === 2) {

            // Start of barcode

            readingBarcode = true;

            e.preventDefault();

            return;

        }



        if (readingBarcode) {

            e.preventDefault();



            if (e.keyCode === 13) { // Enter

                readingBarcode = false;

                var evt = $.Event('barcodeScan');

                evt.state = {

                    type: barcodeRead.substr(0, 1),

                    code: barcodeRead.substr(1),

                };



                $(window).trigger(evt);

                barcodeRead = '';

                return;

            }



            // Append the next key to the end of the list

            barcodeRead += e.key;

        }

    }



