String.prototype.post = function(options,f){
    if(typeof options=="function"){
        f = options;
        options = {
            parent:"form",
            data:function(r){
              return r
            },
            callback :function(r){

            }
          };
    }else{
        options = $.extend({
            parent:"form",
            data:function(r){
              return r
            },
            callback :function(r){

            }
          }, options,true);
    }
  
  var btn = this.toString();
  
  if(!btn.includes("/")){
    var me = $(btn);
      me.off("click").on("click",function(e){
       e.preventDefault();

       var data = me.closest(options.parent).serializeObject();
       if(options.data)options.data(data);
       me.addClass("disabled");
       post(options.url,data,function(r){
          me.removeClass("disabled");   
          if(options.callback)options.callback(r);
       },true);
    });
  }else{
    post(btn,options,function(r){ 
          if(options.callback)options.callback(r);
          if(f)f(r);
    },true);
  }

  
};


